--------------------------------------------------------
--  DDL for Table university
--------------------------------------------------------
CREATE TABLE university (
    university_name  VARCHAR2(128 CHAR),
    country          VARCHAR2(26 CHAR),
    year_founded     NUMBER(38, 0),
    is_public        VARCHAR2(1),
    avg_tuition      INTEGER,
    address_id       integer,
    university_id    INTEGER
        GENERATED BY DEFAULT AS IDENTITY START WITH 1000
); 
set define off;
